SET NAMES UTF8;
DROP DATABASE IF EXISTS eb;
CREATE DATABASE eb CHARSET=UTF8;
USE eb;

# 导航条目
CREATE TABLE navbar_type(
  `tid` INT PRIMARY KEY AUTO_INCREMENT,
  `tname` VARCHAR(16),
  `turl`  VARCHAR(64)
);

# 侧边栏目录
CREATE TABLE category(
  `cid` INT PRIMARY KEY AUTO_INCREMENT,
  `nname` VARCHAR(32),
  `nurl`  VARCHAR(64),
  `tid` INT,
  FOREIGN KEY(tid) REFERENCES navbar_type(tid)
);

# 首页公告
CREATE TABLE notice(
  `nid` INT PRIMARY KEY AUTO_INCREMENT,
  `title` VARCHAR(128),
  `publisher` VARCHAR(12),
  `date` DATETIME,
  `content` VARCHAR(256)
);
因为 src 和 href 没有可以共同应用的标签，没有可比性，所以也就没有区别可言。
src:source 的缩写，表示“源”，可以理解为[引用资源]，就好像用来代替自身的内容。如 img、script、iframe。它们如果不写 src，那么本身没有内容，script 会不存在脚本代码,img 会显示 x,iframe 会显示空白页。
href:Hypertext Reference 的缩写，表示"超链接",目的不是为了引用一个资源，而是为了建立一个"通道"，让当前标签能够链接到目标地址上，并不是为了目标拉进页面本身内容来替换本身的内容，例如 a 标签的 href 不会被当做一个资源替身，link 标签本身并不包含实际的元素意义来做内容，它需要 rel 明确的表示[被链接的文档是做什么的]。'),
(null,'行政区域规划','张三','2018-04-10 18:30:51','<h1>CSS即层叠样式表（Cascading StyleSheet）。</h1>
在网页制作时采用层叠样式表技术，可以有效地对页面的布局、字体、颜色、背景和其它效果实现更加精确的控制。
只要对相应的代码做一些简单的修改，就可以改变同一页面的不同部分，或者页数不同的网页的外观和格式。CSS3是CSS技术的升级版本，CSS3语言开发是朝着模块化发展的。以前的规范作为一个模块实在是太庞大而且比较复杂，所以，把它分解为一些小的模块，更多新的模块也被加入进来。这些模块包括：盒子模型、列表模块、超链接方式、语言模块 、背景和边框 、文字特效、多栏布局等。'),
(null,'项目流程审核','李四','2019-03-25 09:45:04','
1、CSS3圆角表格 CSS3圆角表格 圆角表格，对应属性：border-radius。
2、以往对网页上的文字加特效只能用filter这个属性，这次CSS3中专门制订了一个加文字特效的属性，而且不止加阴影这种效果。对应属性：font-effect。
3、丰富了对链接下划线的样式，以往的下划线都是直线，这次可不一样了，有波浪线、点线、虚线等等，更可对下划线的颜色和位置进行任意改变。（还有对应顶线和中横线的样式，效果与下划线类似）对应属性：text-underline-style，text-underline-color，text-underline-mode，text-underline-position。
4、在文字下点几个点或打个圈以示重点，CSS3也开始加入了这项功能，这应该在某些特定网页上很有用。对应属性：font-emphasize-style和font-emphasize-position。边框border-color:控制边框颜色，并且有了更大的灵活性，可以产生渐变效果');

# 用户列表
CREATE TABLE user(
  `uid` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  `eid` VARCHAR(16),
  `pwd` VARCHAR(32),
  `email` VARCHAR(64),
  `phone` VARCHAR(16) NOT NULL UNIQUE,
  `avatar` VARCHAR(128) DEFAULT 'images/avatar/default.png',
  `user_name` VARCHAR(32),
  `gender` INT,
  `isDelete` INT(4) DEFAULT 0
);

# 订单状态 1作废 2未审核 3已确认 4已发货 5已签收
CREATE TABLE order_status(
  `sid` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  `order_status` VARCHAR(8)
);

# 承运商 1顺丰 2中通 3圆通 4申通 5韵达
CREATE TABLE fwd(
  `fid` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  `fwd` VARCHAR(8)
);

# 订单类型 1特殊物流订单 2上门取件
CREATE TABLE order_type(
  `tid` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  `order_type` VARCHAR(8)
);

# 订单列表 
CREATE TABLE order_list(
  `oid` INT NOT NULL PRIMARY KEY AUTO_INCREMENT,
  `orderNo` VARCHAR(16),
  `orderTime` DATETIME,
  `orderType` INT(4) ,
  `sname` VARCHAR(16),
  `sphone` VARCHAR(16),
  `saddress` VARCHAR(128),
  `gname` VARCHAR(16),   
  `gtype` VARCHAR(16),
  `gamount` INT(16),
  `gweight` DECIMAL(7,1),
  `gvolume` VARCHAR(128),
  `fwd` INT(4),
  `deliveryTime` DATETIME,
  `tNumber` VARCHAR(16),
  `rname` VARCHAR(16),
  `rphone` VARCHAR(16),
  `raddress` VARCHAR(128),
  `status` int(4) DEFAULT 0,
  FOREIGN KEY(orderType) REFERENCES order_type(tid),
  FOREIGN KEY(status) REFERENCES order_status(sid),
  FOREIGN KEY(fwd) REFERENCES fwd(fid)
);
