INSERT INTO notice VALUES(null,'test','管理员','2015-08-14 14:43:50','<h1>什么是响应式布局</h1>在移动互联日益成熟的时候，我们在桌面浏览器上开发的网页已经无法满足移动设备的阅读。通常的做法是针对移动端单独做一套特定的版本。但是如果终端越来越多那么你需要开发的版本就会越来越多（大屏移动设备普及）。那么 Ethan Marcotte 在 2010 年 5 月份提出的一个概念，简而言之，就是一个网站能够兼容多个终端。'),
(null,'向日葵连接','管理员','2016-01-24 09:06:16','<h1>src 和 href 之间存在的区别</h1>
